import { Container } from "@mui/system";
import "../App.css";
import Project from "../components/Project";

import React from "react";

// MUI Grid
import Grid from "@mui/material/Grid";
import Item from "@mui/material/Grid";

function Projects() {
  let blogs = [
    {
      Name: "Peak Performance App (QUT CAPSTONE Project)",
      Topics: "CORs • Same-Origin Policy • CSRF",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
    {
      Name: "Sorting algorithms, which one would win in a race?",
      Topics: "Sorting Algorithms • Big-O Notation",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
    {
      Name: "What's a backend framework and where can I find one?",
      Topics: "Backend Frameworks",
      Desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus lacinia nec augue ac aliquam.",
      Link: "",
    },
  ];

  return (
    <div
      style={{
        width: "100%",
        height: "100%",
        position: "absolute",
        backgroundColor: "#121212",
      }}
    >
      <Container
        className="aboutMe"
        style={{ color: "white", textAlign: "justify", paddingTop: "8vh" }}
      >
        <h1>Projects</h1>
        <Grid container spacing={4}>
          <Grid item>
            <Item style={{ paddingBottom: "10px" }}>
              <Project></Project>
            </Item>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default Projects;
